import React from 'react';
import './Hello.css';

class Hello extends React.Component {
	render() {
		return(
			<div className='f1 tc'>
				 <h1>Hey Ricardo</h1>
				 <h3>{this.props.greeting}</h3>
			</div>
		);
	}
}

const Hi = (props) => {
	return(
		<div className='f2 tc'>
			<p>{props.response}</p>
		</div>
		);
}

export default Hello;
